export class Point {
  constructor(id, key, name, keyName, description, keyDescription, category, points, countPerDay, creationDate) {
    this.id = id;
    this.key = key;
    this.name = name;
    this.keyName = keyName;
    this.description = description;
    this.keyDescription = keyDescription;
    this.category = category;
    this.points = points;
    this.countPerDay = countPerDay;
    this.creationDate = creationDate;
  }
}
export function getPointIdentifier(point) {
  return point.id;
}
